import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import Login from './Login';
import UserSearch from './UserSearch';
import Chat from './Chat';
import FriendsList from './FriendsList';
import api from './api';

function App() {
  const [authUser, setAuthUser] = useState(localStorage.getItem('username'));
  const [activeChat, setActiveChat] = useState(null);
  const [onlineUsers, setOnlineUsers] = useState({});

useEffect(() => {
    if (!authUser) return;

    // Connect to the Status WebSocket we just built in Django
    const statusSocket = new WebSocket(`ws://localhost:8000/ws/status/${authUser}/`);

    statusSocket.onmessage = (event) => {
        const data = JSON.parse(event.data);
        // This updates the "Green Dot" state across the entire app
        setOnlineUsers(prev => ({ 
            ...prev, 
            [data.user]: data.status 
        }));
    };

    return () => statusSocket.close();
}, [authUser]);

  if (!authUser) return <Login setAuthUser={setAuthUser} />;

  // ... (keep your existing imports and states)

return (
  <div style={styles.dashboard}>
    {/* COLUMN 1: NAVIGATION RAIL */}
    <motion.nav 
      initial={{ x: -80 }} animate={{ x: 0 }}
      style={styles.navRail}
    >
      <div style={styles.logoBox}>S</div>
      <div style={styles.navLinks}>
        <div style={styles.activeIcon} title="Chats">üí¨</div>
        <div style={styles.icon} title="Friends">üë•</div>
        <div style={styles.icon} title="Settings">‚öôÔ∏è</div>
      </div>

      {/* CORRECTED: Clear Logout Label */}
      <button 
        onClick={() => { localStorage.clear(); window.location.reload(); }} 
        style={styles.logoutBtn}
      >
        <span style={{fontSize: '20px'}}>Logout</span>
      </button>
    </motion.nav>

    {/* COLUMN 2: SOCIAL SIDEBAR */}
    <motion.aside 
      initial={{ opacity: 0 }} animate={{ opacity: 1 }}
      style={styles.sidebar}
    >
      <header style={styles.sideHeader}>
        {/* NEW: Displaying the Current Logged-in Username */}
        <div style={styles.userProfile}>
           <div style={styles.avatarSmall}>
             {authUser ? authUser[0].toUpperCase() : 'U'}
           </div>
           <div style={styles.userMeta}>
             <span style={styles.welcomeText}>Welcome back,</span>
             <h4 style={styles.currentUserName}>{authUser}</h4>
           </div>
        </div>

        <h2 style={styles.title}>Messages</h2>
        <UserSearch onSelectUser={setActiveChat} />
      </header>

      <div style={styles.friendsContainer}>
        <FriendsList 
          onSelectUser={setActiveChat} 
          onlineUsers={onlineUsers} 
        />
      </div>
    </motion.aside>

    {/* ... (keep the rest of your Chat Viewport code) */}
  </div>
);

// Updated Styles for the Profile Display
const styles = {
  // ... (keep existing dashboard, navRail, logoBox styles)

  logoutBtn: { 
    border: 'none', 
    background: 'none', 
    color: '#ef4444', 
    fontWeight: '700', 
    cursor: 'pointer',
    fontSize: '12px',
    transition: 'opacity 0.2s'
  },
  userProfile: {
    display: 'flex',
    alignItems: 'center',
    gap: '12px',
    marginBottom: '20px',
    padding: '10px',
    background: 'rgba(255,255,255,0.03)',
    borderRadius: '12px'
  },
  avatarSmall: {
    width: '36px',
    height: '36px',
    borderRadius: '10px',
    background: 'linear-gradient(135deg, #6366f1, #a855f7)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    fontWeight: 'bold',
    color: '#fff'
  },
  userMeta: {
    display: 'flex',
    flexDirection: 'column'
  },
  welcomeText: {
    fontSize: '10px',
    color: '#94a3b8',
    textTransform: 'uppercase',
    letterSpacing: '0.5px'
  },
  currentUserName: {
    margin: 0,
    fontSize: '16px',
    color: '#f8fafc',
    fontWeight: '600'
  },
  // ... (keep existing sidebar, title, etc. styles)
};
}

export default App;
